    pivot = nums[(low + high) // 2]
    while low < high:
        while nums[low] < pivot:
            low += 1
        while nums[high] > pivot:
            high -= 1
        if low <= high:
            (nums[low], nums[high]) = (nums[high], nums[low])
            (low, high) = (low + 1, high - 1)
    return low

